import React from "react";
import reactDom from "react-dom";
import Logo from "../images/react-logo2.png";


export default function Navbar(){
    return(
        <nav>
            <img src={Logo} alt="React Logo" />
            <h3>ReactFacts</h3>
            <h4>React Course - Project 1</h4>
        </nav>
    )
}
